                        <a href=""><img src="" alt="GitHub" /></a>
                        <a href=""><img src="" alt="LinkedIn" /></a>
                        <a href=""><img src="" alt="Facebook" /></a>
                        <a href=""><img src="" alt="Twiter" /></a>
                        
                    </div>
                </section>
                <section>
                    <article>
                        <img src="" alt="" />
                        <h2></h2>
                    </article>
                </section>
            </main>
        </div>
    )

};

export default Home;
